import './App.css';
import React, { Component } from 'react';
import axios from 'axios';
import {Table} from './table';

class App extends Component {
  constructor() {
      super();
      this.state = {
          journals: []
      }
  }

  componentDidMount() {
    const payload = {"filter":"{}",
      "ignoreAssociation": true,
      "isPaginateDB": true,
      "modelType": "journals",
      "page":1,
      "pageSize":100
    };
    var journals = this.state.journals;
    axios.post('http://o-research-dev.orlab.com.vn/api/v1/filters/filter/', {payload})
      .then(res => {
        console.log(res);
        console.log(res.data);
        this.state.journals = res.data.data;
        this.setState(this.state);
      })
  }

  renderJournals = () => {
      let journals = this.state.journals.map((data, index) =>
          <tr key={data.id}>
            <td>{data.id}</td>
            <td>{data.title}</td>
            <td>{data.totalDocs}</td>
            <td>{data.country}</td>
            <td>{data.publisher}</td>
            <td>{data.year}</td>
          </tr>
      );

      return journals;
  }

  render() {
    return (
      <div className="App">
        <div className="container">
          <h1 className="text-center">Journals List</h1>
          <Table/>
        </div>
      </div>
    );
  }
}

export default App;
